export const NotificationSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="NotificationSolidIcon">
    <path d="M1 8c.466-.193.799-.859 1-2V3a3 3 0 0 1 3-3h2a3 3 0 0 1 3 3v3.005l.042.217C10.246 7.228 10.565 7.82 11 8h1v1H0V8zm5 4c-.828 0-1.5-.621-1.5-1.389V10h3v.611C7.5 11.379 6.828 12 6 12z" />
  </svg>,
  "NotificationSolid",
  "notification solid"
);
